import React from "react";

export const Page2 = () => {
  return <div className="page2">
    <h1 className="page2__title">The majority our customers do not understand their workflows.</h1>
    <p className="page2__text">Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
    <div className="page2__items">
      <div className="page2"></div>
    </div>
  </div>;
};
